import React from 'react';
import {Typography} from '@material-ui/core';

function Job({job}){

    return (
    <div className="job">
        <Typography>{job.title}</Typography>
        <p>{job.company}</p>
        <p>{job.location}</p>

    </div>
    )

}

export default Job;
